import React, {useState} from 'react';
import axios from "axios";

const NewArticleForm = () => {

    const [formData, setFormData] = useState({
        title: "",
        header: "",
        imageUrl: "",
        body: "",
        imageUrl1: "",
        imageUrl2: "",
        imageUrl3: "",
    });

    const handleSubmit = (event) => {
        event.preventDefault();
        axios.post("http://localhost:5098/CreateArticle", formData)
            .then((response) => {
                console.log(response.data);
            })
            .catch((error) => {
                console.error("Error:", error);
            });
    };

    const handleChange = (event) => {
        const { name, value } = event.target;
        setFormData((prevFormData) => ({
            ...prevFormData,
            [name]: value,
        }));
    };



    return (
        <>
            <div className={"container"}>
                <div className={"row"}>
                    <form onSubmit={handleSubmit}>
                        <div className={"col-xl-12"}>
                            <div className={"row"}>
                                <div className={"col-xl-2"}>
                                    <label htmlFor="title">Title:</label>
                                </div>
                                <div className={"col-xl-10"}>
                                    <input type="text" id="title" name="title" value={formData.title} onChange={handleChange}/>
                                </div>
                                <div className={"col-xl-2"}>
                                    <label htmlFor="header">Header:</label>
                                </div>
                                <div className={"col-xl-10"}>
                                    <input type="text" id="header" name="header" value={formData.header} onChange={handleChange}/>
                                </div>
                                <div className={"col-xl-2"}>
                                <label htmlFor="imageUrl">Image URL:</label>
                                </div>
                                <div className={"col-xl-10"}>
                                <input type="text" id="imageUrl" name="imageUrl" value={formData.imageUrl} onChange={handleChange}/>
                                </div>
                                <label htmlFor="body">Body:</label>
                                <textarea id="body" name="body" value={formData.body} onChange={handleChange}/>
                                <label htmlFor="imageUrl1">Image URL 1:</label>
                                <input type="text" id="imageUrl1" name="imageUrl1" value={formData.imageUrl1} onChange={handleChange}/>
                                <label htmlFor="imageUrl2">Image URL 2:</label>
                                <input type="text" id="imageUrl2" name="imageUrl2" value={formData.imageUrl2} onChange={handleChange}/>
                                <label htmlFor="imageUrl3">Image URL 3:</label>
                                <input type="text" id="imageUrl3" name="imageUrl3" value={formData.imageUrl3} onChange={handleChange}/>
                                <button type="submit">Submit</button>
                            </div>

                        </div>
                    </form>
                </div>
            </div>
        </>
    );
};

export default NewArticleForm;
